import Button from "./components/Button/Button";

let bannerTitle = "";
let bannerSubTitle = "Sub Title";

function App() {
  return (
    <div className="App">
      <HeroBanner className="mainBanner">
        {
         bannerTitle !== '' ? <h1>{bannerTitle}</h1> : '' 
        }
        <Button type="button" className="btn-primary">Explore Now</Button>
      </HeroBanner>
    </div>
  );
}

export default App;
